import React, { useState, useEffect, useRef } from 'react';
import { View, Text, StyleSheet, TouchableOpacity, Dimensions } from 'react-native';
import { saveScan } from '../services/Database';

const { width } = Dimensions.get('window');

const ImagingScreen = ({ route, navigation }) => {


    // If viewing past record
    const existingPatient = route.params?.patient;

    // State: 'intake', 'scanning', 'result', 'view'
    const [mode, setMode] = useState(existingPatient ? 'view' : 'intake');

    // Intake Form State
    const [patientDetails, setPatientDetails] = useState({
        name: '',
        dob: '',
        sex: '',
        history: '',
        photoUri: null,
    });

    // Scanning State
    // If viewing past record, use its data. Else init empty.
    const [spectrogramData, setSpectrogramData] = useState(existingPatient?.spectrogramData || []);
    const [isScanning, setIsScanning] = useState(false); // Used for interval control
    const [result, setResult] = useState(existingPatient || null);

    useEffect(() => {
        if (existingPatient) {
            setResult(existingPatient);
        }
    }, [existingPatient]);

    // Simulate Spectrogram Data Stream
    useEffect(() => {
        let interval;
        if (isScanning) {
            interval = setInterval(() => {
                // Generate random height bars to simulate frequency intensities
                const newColumn = Array.from({ length: 20 }, () => Math.random());
                setSpectrogramData(prev => {
                    const newData = [...prev, newColumn];
                    if (newData.length > 30) newData.shift(); // Keep window moving
                    return newData;
                });
            }, 100);

            // Simulate Scan Completion after 5 seconds
            setTimeout(() => {
                finishScan();
            }, 5000);
        }
        return () => clearInterval(interval);
    }, [isScanning]);

    const startScan = () => {
        setIsScanning(true);
        setResult(null);
        setSpectrogramData([]);
    };

    const finishScan = async () => {
        setIsScanning(false);
        // Mock Result
        const outcomes = [
            { d: 'Normal', s: 'STABLE', c: 0.95 },
            { d: 'Wheezes Detected', s: 'URGENT', c: 0.89 },
            { d: 'Absent Breath Sounds', s: 'CRITICAL', c: 0.91 }
        ];
        const outcome = outcomes[Math.floor(Math.random() * outcomes.length)];

        const saved = await saveScan(patientDetails, outcome.d, outcome.c, outcome.s, spectrogramData);
        setResult(saved);
    };

    const pickImage = async () => {
        let result = await ImagePicker.launchImageLibraryAsync({
            mediaTypes: ImagePicker.MediaTypeOptions.Images,
            allowsEditing: true,
            aspect: [4, 3],
            quality: 0.5,
        });

        if (!result.canceled) {
            setPatientDetails(prev => ({ ...prev, photoUri: result.assets[0].uri }));
        }
    };

    // 1. INTAKE FORM VIEW
    if (mode === 'intake') {
        return (
            <ScrollView style={styles.containerIntake} contentContainerStyle={styles.content}>
                <Text style={styles.headerTitle}>New Patient Intake</Text>

                <TouchableOpacity style={styles.imageUpload} onPress={pickImage}>
                    {patientDetails.photoUri ? (
                        <Image source={{ uri: patientDetails.photoUri }} style={styles.patientPhoto} />
                    ) : (
                        <Text style={styles.uploadText}>+ Add Patient Photo</Text>
                    )}
                </TouchableOpacity>

                <View style={styles.formGroup}>
                    <Text style={styles.label}>Full Name</Text>
                    <TextInput
                        style={styles.input}
                        placeholder="e.g. John Doe"
                        value={patientDetails.name}
                        onChangeText={(t) => setPatientDetails({ ...patientDetails, name: t })}
                    />
                </View>

                <View style={styles.row}>
                    <View style={[styles.formGroup, { flex: 1, marginRight: 8 }]}>
                        <Text style={styles.label}>Date of Birth</Text>
                        <TextInput
                            style={styles.input}
                            placeholder="MM/DD/YYYY"
                            value={patientDetails.dob}
                            onChangeText={(t) => setPatientDetails({ ...patientDetails, dob: t })}
                        />
                    </View>
                    <View style={[styles.formGroup, { flex: 1, marginLeft: 8 }]}>
                        <Text style={styles.label}>Sex</Text>
                        <TextInput
                            style={styles.input}
                            placeholder="M/F/Other"
                            value={patientDetails.sex}
                            onChangeText={(t) => setPatientDetails({ ...patientDetails, sex: t })}
                        />
                    </View>
                </View>

                <View style={styles.formGroup}>
                    <Text style={styles.label}>History / Conditions</Text>
                    <TextInput
                        style={[styles.input, { height: 80 }]}
                        multiline
                        placeholder="e.g. History of asthma..."
                        value={patientDetails.history}
                        onChangeText={(t) => setPatientDetails({ ...patientDetails, history: t })}
                    />
                </View>

                <TouchableOpacity style={styles.button} onPress={startScan}>
                    <Text style={styles.buttonText}>Start Diagnostic Scan</Text>
                </TouchableOpacity>
            </ScrollView>
        );
    }

    const renderSpectrogram = () => {
        if (spectrogramData.length === 0 && mode !== 'scanning') return null;

        return (
            <View style={styles.spectrogramContainer}>
                {spectrogramData.map((col, i) => (
                    <View key={i} style={styles.spectrogramColumn}>
                        {col.map((val, j) => (
                            <View key={j} style={[styles.spectrogramCell, { backgroundColor: `rgba(59, 130, 246, ${val})` }]} />
                        ))}
                    </View>
                ))}
            </View>
        );
    };

    return (
        <View style={styles.container}>
            <View style={styles.displayArea}>
                {renderSpectrogram()}
                {mode === 'scanning' && <Text style={styles.scanningText}>Acquiring Acoustic Data...</Text>}
            </View>

            <View style={styles.controls}>
                {result ? (
                    <View style={styles.resultContainer}>
                        <Text style={styles.resultTitle}>Diagnosis Complete</Text>
                        <Text style={[
                            styles.resultStatus,
                            { color: result.status === 'CRITICAL' ? 'red' : result.status === 'URGENT' ? 'orange' : 'green' }
                        ]}>
                            {result.status}
                        </Text>
                        <Text style={styles.diagnosisText}>{result.diagnosis}</Text>
                        <Text style={styles.confidence}>Confidence: {(result.confidence * 100).toFixed(1)}%</Text>

                        {!existingPatient &&
                            <TouchableOpacity style={styles.button} onPress={() => navigation.goBack()}>
                                <Text style={styles.buttonText}>Return to Dashboard</Text>
                            </TouchableOpacity>
                        }
                    </View>
                ) : (
                    <TouchableOpacity
                        style={[styles.button, isScanning && styles.buttonDisabled]}
                        onPress={startScan}
                        disabled={isScanning}
                    >
                        <Text style={styles.buttonText}>{isScanning ? 'Scanning...' : 'Start Capture'}</Text>
                    </TouchableOpacity>
                )}
            </View>
        </View>
    );
};

const styles = StyleSheet.create({
    container: { flex: 1, backgroundColor: '#09090b' },
    containerIntake: { flex: 1, backgroundColor: '#f4f4f5' },
    content: { padding: 20 },
    headerTitle: { fontSize: 24, fontWeight: 'bold', marginBottom: 20, color: '#18181b' },
    imageUpload: {
        height: 150, backgroundColor: '#e4e4e7', borderRadius: 12,
        justifyContent: 'center', alignItems: 'center', marginBottom: 20, overflow: 'hidden'
    },
    uploadText: { color: '#71717a', fontWeight: '600' },
    patientPhoto: { width: '100%', height: '100%' },
    formGroup: { marginBottom: 16 },
    row: { flexDirection: 'row' },
    label: { fontSize: 14, color: '#52525b', marginBottom: 6, fontWeight: '500' },
    input: {
        backgroundColor: '#fff', borderWidth: 1, borderColor: '#d4d4d8',
        borderRadius: 8, padding: 12, fontSize: 16
    },
    scanningText: { color: '#3b82f6', marginTop: 20, fontSize: 16, fontWeight: '600', letterSpacing: 1 },
    diagnosisText: { color: '#fff', fontSize: 18, marginBottom: 8, textAlign: 'center' },

    displayArea: {
        flex: 2,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#000',
        borderBottomWidth: 1,
        borderBottomColor: '#27272a'
    },
    spectrogramContainer: {
        flexDirection: 'row',
        height: 200,
        alignItems: 'flex-end',
        justifyContent: 'center',
        gap: 2
    },
    spectrogramColumn: {
        flexDirection: 'column-reverse',
        gap: 1
    },
    spectrogramCell: {
        width: 8,
        height: 8,
        borderRadius: 1
    },
    placeholderGraph: { justifyContent: 'center', alignItems: 'center' },
    placeholderText: { color: '#52525b' },
    controls: { flex: 1, padding: 20, justifyContent: 'center' },
    button: {
        backgroundColor: '#3b82f6',
        padding: 16,
        borderRadius: 12,
        alignItems: 'center',
    },
    buttonDisabled: { backgroundColor: '#1e3a8a' },
    buttonText: { color: '#fff', fontSize: 18, fontWeight: 'bold' },
    resultContainer: { alignItems: 'center', gap: 10 },
    resultTitle: { color: '#fff', fontSize: 20 },
    resultStatus: { fontSize: 24, fontWeight: 'bold' },
    confidence: { color: '#a1a1aa' }
});

export default ImagingScreen;
